  return (

    <div className=''>
    <div className='container'>
        <div className='Box'>
          <BBA />
        </div>

        <div className='Box'>
          <Dac />
        </div>

        <div className='Box'>
          <IconButton  />
        </div>
        <div className='Box'>
          <JFK />
        </div>

        <div className='Box'>
          <Total />
        </div>
      </div>

      <div>
        <Navbar />
      </div>
    </div>

  );
};

export default App;
